import { useState } from 'react';
import './App.css';

import Content from './Content';



function App() {
  const [entered, setEntered] = useState(false);


  const handleClick= () => {
    setEntered(true)
  }
  return (
    <div className="App">
      {!entered && <WelcomePage onEnter={handleClick}/>}
      {entered && <Content/>}

    </div>
  );
}

export default App;
